import React from 'react';
import classes from './Order.module.css';


const order = (props) => {

    const ingredients = [];
    const address = [];

    let str = JSON.parse(props.ingredients);
    str.forEach(ing => {
        ingredients.push(Object.keys(ing) + "(" + Object.values(ing) + ")");
    });

    console.log(ingredients);
    return(  
        <div className={classes.Order}>
            <p>Ingredients: salad: 1</p>
            <p>price:10</p>
        </div>
        );
};

export default order;
